  false,\n\t\"url\": null,\n\t\"notes\": \"There are four spring systems that contribute
  flow to the Frenchglen or P Ranch Area of Malheur NWR. One of these systems flows
  into the Blitzen River and the other three flow into East or West Canals. Flow estimates
  are needed from each of these spring systems to evaluate the total inflow to this
  part of the refuge. The purpose of this report is to identify and discuss each spring
  system and provide flow estimates for each.\",\n\t\"license_title\": \"License Not
